import { MDBIcon, MDBBtn} from 'mdbreact';
import "./MatchBtns.css"

function MatchBtns() {
    return(
    <div className= 'MatchBtns'>
        <MDBIcon icon="redo" />
        <MDBIcon icon="times" />
        <MDBIcon far icon="heart" />

    </div>
    )
}

export default MatchBtns;
